static bool init_memory(wasm2c_sandbox_t* const sbx, uint32_t max_wasm_pages_from_rt) {
  const uint32_t max_pages_specified_in_module = 0;
  const uint32_t max_pages = max_wasm_pages_from_rt == 0? max_pages_specified_in_module : max_wasm_pages_from_rt;
  const bool success = wasm_rt_allocate_memory(&(sbx->w2c_memory), 64, max_pages);
  if (!success) { return false; }
  
  LOAD_DATA(sbx->w2c_memory, 100000u, data_segment_data_0, 2672);
  LOAD_DATA(sbx->w2c_memory, 102672u, data_segment_data_1, 3364);
  sbx->wasi_data.heap_memory = &(sbx->w2c_memory);
  return true;
}

static void cleanup_memory(wasm2c_sandbox_t* const sbx) {
  wasm_rt_deallocate_memory(&(sbx->w2c_memory));
}

static wasm_rt_memory_t* get_wasm2c_memory(void* aSbx) {
  wasm2c_sandbox_t* const sbx = (wasm2c_sandbox_t* const) aSbx;return &(sbx->w2c_memory);
}

static void init_table(wasm2c_sandbox_t* const sbx) {
  uint32_t offset = 0;
  wasm_rt_allocate_table(&(sbx->w2c___indirect_function_table), 9, 4294967295);
  offset = 1u;
  sbx->w2c___indirect_function_table.data[offset + 0] = (wasm_rt_elem_t){ WASM_RT_INTERNAL_FUNCTION, sbx->func_types[0], (wasm_rt_anyfunc_t)(&w2c_default_bzalloc) };
  sbx->w2c___indirect_function_table.data[offset + 1] = (wasm_rt_elem_t){ WASM_RT_INTERNAL_FUNCTION, sbx->func_types[2], (wasm_rt_anyfunc_t)(&w2c_default_bzfree) };
  sbx->w2c___indirect_function_table.data[offset + 2] = (wasm_rt_elem_t){ WASM_RT_INTERNAL_FUNCTION, sbx->func_types[1], (wasm_rt_anyfunc_t)(&w2c_g_serviceFn) };
  sbx->w2c___indirect_function_table.data[offset + 3] = (wasm_rt_elem_t){ WASM_RT_INTERNAL_FUNCTION, sbx->func_types[3], (wasm_rt_anyfunc_t)(&w2c_sel_true) };
  sbx->w2c___indirect_function_table.data[offset + 4] = (wasm_rt_elem_t){ WASM_RT_INTERNAL_FUNCTION, sbx->func_types[3], (wasm_rt_anyfunc_t)(&w2c___stdio_close) };
  sbx->w2c___indirect_function_table.data[offset + 5] = (wasm_rt_elem_t){ WASM_RT_INTERNAL_FUNCTION, sbx->func_types[0], (wasm_rt_anyfunc_t)(&w2c___stdio_write) };
  sbx->w2c___indirect_function_table.data[offset + 6] = (wasm_rt_elem_t){ WASM_RT_INTERNAL_FUNCTION, sbx->func_types[4], (wasm_rt_anyfunc_t)(&w2c___stdio_seek) };
  sbx->w2c___indirect_function_table.data[offset + 7] = (wasm_rt_elem_t){ WASM_RT_INTERNAL_FUNCTION, sbx->func_types[0], (wasm_rt_anyfunc_t)(&w2c___stdout_write) };
  sbx->w2c___indirect_function_table_current_index = offset + 8;
}

static void cleanup_table(wasm2c_sandbox_t* const sbx) {
  wasm_rt_deallocate_table(&(sbx->w2c___indirect_function_table));
}

